    ... on AmountDifferenceOption {
      highlightAmountDifferenceField
      __typename
    }
    ... on StatusIndicatorOption {
      statusIndicatorCurrentStatusField
      statusIndicatorDescriptorField
      statusIndicatorVerboseField
      __typename
    }
    ... on TagOption {
      tagColorField
      tagIconField
      __typename
    }
    ... on TagButtonListOption {
      tagButtonColorsField
      tagButtonIconsField
      tagButtonHrefsField
      tagButtonTooltipsField
