      __typename
    }
    ... on LinkOption {
      displayNameField
      openNewTab
      __typename
    }
    ... on TagListOption {
      tagColorsField
      tagIconsField
      __typename
    }
    ... on JSONOption {
      collapsed
      __typename
    }
    __typename
